@AdamHunter's ethereal home theater 🌌 in Sag Harbor, NY for Galerie House of Art & Design. Thoughts? Swipe left rate the transformation.
The walls are sheathed in a starry wallpaper designed by Adam Hunter and Fromental made using real diamond dust, and 575 fiber optic LEDs were laced through the wallpaper in the ceiling, creating actual starry lights! This otherworldly space is an epic party spot where cinephiles can enjoy movie night ✨ 
#adamhunter #architects_need

